import React from 'react';

function Login() {
  return (
    <main className="container m-auto">
      <div className="flex mt-12 justify-center">
        <h2>Sign in --- </h2>
        <form>
          <input
            type="text"
            className="border-black border-solid border"
            placeholder="login"
          />
          <input type="text" />
          <button type="submit" className="p-4 bg-slate-400 shad">login</button>
        </form>
      </div>
    </main>
  );
}

export default Login;
